		$templateCache.put('modules/chat/client/views/chat.client.view.html', '<!-- The chat view -->\n<section class=\"container\">\n  <div class=\"page-header\">\n    <h1>Chat Example</h1>\n  </div>\n  <!-- The message form -->\n  <form class=\"col-xs-12 col-md-offset-4 col-md-4\" ng-submit=\"vm.sendMessage();\">\n    <fieldset class=\"row\">\n      <div class=\"input-group\">\n        <input type=\"text\" id=\"messageText\" name=\"messageText\" class=\"form-control\" ng-model=\"vm.messageText\" placeholder=\"Enter new message\">\n        <span class=\"input-group-btn\">\n          <button type=\"submit\" class=\"btn btn-primary\" ng-disabled=\"!vm.messageText.length\">Submit</button>\n        </span>\n      </div>\n    </fieldset>\n  </form>\n  <ul class=\"list-unstyled\">\n    <!-- List all messages -->\n    <li class=\"col-xs-12 col-md-offset-4 col-md-4 chat-message\" ng-repeat=\"message in vm.messages\">\n      <small class=\"pull-right text-muted\" ng-bind=\"message.created | date:\'mediumTime\'\"></small>\n      <img ng-src=\"{{message.profileImageURL}}\" alt=\"{{message.username}}\" class=\"pull-left chat-profile-image\" />\n      <div class=\"pull-left chat-message-details\">\n        <strong ng-bind=\"message.username\"></strong>\n        <br>\n        <span ng-bind=\"message.text\"></span>\n      </div>\n    </li>\n  </ul>\n</section>\n');
		$templateCache.put('modules/about/client/views/about.client.view.html', '<!-- The about view -->\n<section class=\"container about-section\">\n  <div class=\"page-header\">\n    <h1>About Kwong Lum</h1>\n  </div>\n  <div class=\"text-center about-img\">\n    <img src=\"modules/about/client/img/kwong.jpg\" alt=\"Kwong Lum\"/>\n  </div>\n  <p>Kwong Lum started collecting ancient Chinese artwork as a nine-year-old in Hong Kong under the guidance of his art teacher, Ding Yanyong, himself hailed as leading figure in the renewal of the ancient China tradition for modern expression and a fervent collector, who taught him Chinese painting, calligraphy and most of all, the appraisal and collection of Chinese antiques. Thus began his Sai Yang Tang Collection. </p>\n  <p>As a renowned Chinese artist, scholar and collector, Lum has immensely enlarged the volume of his collection by adding in ancient masters’ painting and calligraphy, bronzes, sculpture and porcelain ware of different dynasties, purchased throughout the world at auctions or from private collectors. Today, his Sai Yang Tang Collection in the United States, boasting of its invaluable art treasures of ancient China, enjoys a far-reaching reputation of “A Smaller-Sized Overseas Palace Museum.” In 1999, a Kwong Lum National Art Treasure Exhibition was held by Asian Cultural Center in New York, commemorating the 50th Anniversary on the formation of Sai Yang Tang Collection. </p>\n  <p>China’s CCTV “National Treasure Archives” program has made a special trip to New York to interview Lum and they documented four television episodes in the CCTV broadcast. </p>\n  <p>In 2012, Guangdong Government built a museum named “Kwong Lum Art Museum” at Jiangmen City. The museum opened in 2014 and houses Lum’s Paintings and treasures of Sai Yang Tang’s Collection. </p>\n  <p>Lum will be launching his On-Line Museum and hold series of Exhibitions of his Collection. The first will be on Ancient and Gilt Bronzes, with over one hundred Bronze pieces. This collection starts from the Qijia Culture at the end of the third millennium B.C., and Erlitou period up to Han Dynasty. Highlighted by rare and prestigious bronze objects with technical excellence, unsurpassed refinement, signifying political power, devout spiritual beliefs, and exalted social status.</p>\n  <!-- The message form -->\n  <!--<form class=\"col-xs-12 col-md-offset-4 col-md-4\" ng-submit=\"vm.sendMessage();\">\n    <fieldset class=\"row\">\n      <div class=\"input-group\">\n        <input type=\"text\" id=\"messageText\" name=\"messageText\" class=\"form-control\" ng-model=\"vm.messageText\" placeholder=\"Enter new message\">\n        <span class=\"input-group-btn\">\n          <button type=\"submit\" class=\"btn btn-primary\" ng-disabled=\"!vm.messageText.length\">Submit</button>\n        </span>\n      </div>\n    </fieldset>\n  </form>-->\n  <!--<ul class=\"list-unstyled\">\n    <li class=\"col-xs-12 col-md-offset-4 col-md-4 chat-message\" ng-repeat=\"message in vm.messages\">\n      <small class=\"pull-right text-muted\" ng-bind=\"message.created | date:\'mediumTime\'\"></small>\n      <img ng-src=\"{{message.profileImageURL}}\" alt=\"{{message.username}}\" class=\"pull-left chat-profile-image\" />\n      <div class=\"pull-left chat-message-details\">\n        <strong ng-bind=\"message.username\"></strong>\n        <br>\n        <span ng-bind=\"message.text\"></span>\n      </div>\n    </li>\n  </ul>-->\n</section>\n');
